"use strict";

function totalHammingDistance(nums) {
    let ans = 0;
    for (let i = 0; i < 31; i++) {
        let a = 0, b = 0;
        for (let v of nums) {
            let t = (v >> i) & 1;
            if (t) {
                a += 1;
            } else {
                b += 1;
            }
        }
        ans += a * b;
    }
    return ans;
}
